SELECT ?coAuthor ?coAuthorName ?affiliation WHERE {
  ?pub dblp:authoredBy <https://dblp.org/pid/79/3065> ; rdfs:label ?label .
  FILTER ( REGEX( ?label , "\\((201[5-9]|202[0-4])\\)" , "i" ) ) ?pub dblp:authoredBy ?coAuthor .
